import React, { useState, useEffect } from 'react';
import { useAuth } from '../context/AuthContext';
import { FaUser, FaSignOutAlt, FaHome, FaBell, FaFileAlt, FaSubscript, FaCreditCard } from 'react-icons/fa';
import axios from 'axios';

const UserDashboard = () => {
  const { user, logout } = useAuth();
  const [userSubscriptions, setUserSubscriptions] = useState([]);
  const [userTransactions, setUserTransactions] = useState([]);
  const [availablePlans, setAvailablePlans] = useState([]);
  const [showPlansModal, setShowPlansModal] = useState(false);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    if (user?.email) {
      fetchUserData();
    }
  }, [user]);

  const fetchUserData = async () => {
    try {
      const [subsRes, transRes, plansRes] = await Promise.all([
        axios.get('http://localhost:8000/api/subscriptions/'),
        axios.get('http://localhost:8000/api/transactions/'),
        axios.get('http://localhost:8000/api/subscription-plans/')
      ]);

      // Filter data for current user - only active subscriptions
      const userSubs = subsRes.data.filter(sub => 
        sub.user_email === user.email && sub.status === 'active'
      );
      const userTrans = transRes.data.filter(trans => trans.user_name && trans.user_name.includes(user.name));

      setUserSubscriptions(userSubs);
      setUserTransactions(userTrans);
      setAvailablePlans(plansRes.data.filter(plan => plan.status === 'Active'));
    } catch (error) {
      console.error('Error fetching user data:', error);
    } finally {
      setLoading(false);
    }
  };

  const handleLogout = () => {
    logout();
    window.location.href = '/login';
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-blue-50 via-indigo-50 to-purple-50">
      {/* Header */}
      <header className="bg-white/80 backdrop-blur-md shadow-lg border-b border-white/20">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="flex justify-between items-center h-16">
            <div className="flex items-center">
              <div className="bg-gradient-to-r from-blue-600 to-purple-600 p-2 rounded-lg mr-3">
                <FaHome className="text-white text-xl" />
              </div>
              <h1 className="text-xl font-bold bg-gradient-to-r from-blue-600 to-purple-600 bg-clip-text text-transparent">User Dashboard</h1>
            </div>
            <div className="flex items-center space-x-4">
              <span className="text-sm font-medium text-gray-700">Welcome, {user?.name || user?.email}</span>
              <button
                onClick={handleLogout}
                className="flex items-center text-gray-600 hover:text-red-600 transition-colors duration-200 font-medium"
              >
                <FaSignOutAlt className="mr-1" />
                Logout
              </button>
            </div>
          </div>
        </div>
      </header>

      {/* Main Content */}
      <main className="max-w-7xl mx-auto py-6 sm:px-6 lg:px-8">
        <div className="px-4 py-6 sm:px-0">
          {/* Welcome Card */}
          <div className="bg-gradient-to-r from-blue-600 to-purple-600 rounded-2xl shadow-xl mb-8 overflow-hidden">
            <div className="px-6 py-8 text-white">
              <h3 className="text-2xl font-bold mb-3">
                Welcome back, {user?.name || 'User'}! ðŸŽ‰
              </h3>
              <p className="text-blue-100 text-lg">
                You have {userSubscriptions.length} active subscription(s) and {userTransactions.length} transaction(s).
              </p>
            </div>
            <div className="bg-white/10 backdrop-blur-sm px-6 py-4">
              <p className="text-white/80 text-sm">Manage your subscriptions and track your activity from your personalized dashboard.</p>
            </div>
          </div>

          {/* Stats Cards */}
          <div className="grid grid-cols-1 md:grid-cols-4 gap-6 mb-6">
            <div className="bg-white overflow-hidden shadow rounded-lg">
              <div className="p-5">
                <div className="flex items-center">
                  <FaSubscript className="h-6 w-6 text-blue-600 mr-3" />
                  <div>
                    <p className="text-sm font-medium text-gray-500">My Subscriptions</p>
                    <p className="text-2xl font-bold text-gray-900">{userSubscriptions.length}</p>
                  </div>
                </div>
              </div>
            </div>
            <div className="bg-white overflow-hidden shadow rounded-lg">
              <div className="p-5">
                <div className="flex items-center">
                  <FaCreditCard className="h-6 w-6 text-green-600 mr-3" />
                  <div>
                    <p className="text-sm font-medium text-gray-500">Transactions</p>
                    <p className="text-2xl font-bold text-gray-900">{userTransactions.length}</p>
                  </div>
                </div>
              </div>
            </div>
            <div className="bg-white overflow-hidden shadow rounded-lg">
              <div className="p-5">
                <div className="flex items-center">
                  <FaBell className="h-6 w-6 text-yellow-600 mr-3" />
                  <div>
                    <p className="text-sm font-medium text-gray-500">Notifications</p>
                    <p className="text-2xl font-bold text-gray-900">3</p>
                  </div>
                </div>
              </div>
            </div>
            <div className="bg-white overflow-hidden shadow rounded-lg">
              <div className="p-5">
                <div className="flex items-center">
                  <FaUser className="h-6 w-6 text-purple-600 mr-3" />
                  <div>
                    <p className="text-sm font-medium text-gray-500">Account Status</p>
                    <p className="text-lg font-bold text-green-600">Active</p>
                  </div>
                </div>
              </div>
            </div>
          </div>

          {/* My Active Subscriptions */}
          <div className="bg-white shadow rounded-lg mb-6">
            <div className="px-6 py-4 border-b border-gray-200">
              <h3 className="text-lg font-medium text-gray-900">My Active Plans</h3>
            </div>
            <div className="p-6">
              {loading ? (
                <div className="animate-pulse space-y-4">
                  <div className="h-4 bg-gray-200 rounded w-3/4"></div>
                  <div className="h-4 bg-gray-200 rounded w-1/2"></div>
                </div>
              ) : userSubscriptions.length > 0 ? (
                <div className="space-y-4">
                  {userSubscriptions.map((subscription) => (
                    <div key={subscription.subscription_id} className="border border-gray-200 rounded-lg p-4">
                      <div className="flex justify-between items-start">
                        <div>
                          <h4 className="text-lg font-medium text-gray-900">{subscription.plan_name}</h4>
                          <p className="text-sm text-gray-600">{subscription.subscription_type} subscription</p>
                          <p className="text-sm text-gray-500">Started: {subscription.start_date}</p>
                          <p className="text-sm text-gray-500">Last Billed: {subscription.last_billed_date || 'Not billed yet'}</p>
                        </div>
                        <div className="text-right">
                          <p className="text-lg font-bold text-gray-900">${subscription.plan_price}</p>
                          <span className="inline-flex px-2 py-1 text-xs font-semibold rounded-full bg-green-100 text-green-800">
                            Active Plan
                          </span>
                          <p className="text-xs text-gray-500 mt-1">Next billing: {subscription.last_renewed_date || 'TBD'}</p>
                        </div>
                      </div>
                    </div>
                  ))}
                </div>
              ) : (
                <div className="text-center py-8">
                  <p className="text-gray-500 mb-4">No active plans found.</p>
                  <button 
                    onClick={() => setShowPlansModal(true)}
                    className="bg-blue-600 text-white px-4 py-2 rounded-lg hover:bg-blue-700 transition"
                  >
                    Browse Plans
                  </button>
                </div>
              )}
            </div>
          </div>

          {/* Recent Transactions */}
          <div className="bg-white shadow rounded-lg">
            <div className="px-6 py-4 border-b border-gray-200">
              <h3 className="text-lg font-medium text-gray-900">Recent Transactions</h3>
            </div>
            <div className="p-6">
              {loading ? (
                <div className="animate-pulse space-y-4">
                  <div className="h-4 bg-gray-200 rounded w-3/4"></div>
                  <div className="h-4 bg-gray-200 rounded w-1/2"></div>
                </div>
              ) : userTransactions.length > 0 ? (
                <div className="space-y-4">
                  {userTransactions.slice(0, 5).map((transaction) => (
                    <div key={transaction.billing_id} className="flex justify-between items-center border-b border-gray-100 pb-3">
                      <div>
                        <p className="text-sm font-medium text-gray-900">{transaction.plan_name}</p>
                        <p className="text-xs text-gray-500">{transaction.billing_date}</p>
                      </div>
                      <div className="text-right">
                        <p className="text-sm font-bold text-gray-900">${transaction.amount}</p>
                        <span className={`inline-flex px-2 py-1 text-xs font-semibold rounded-full ${
                          transaction.payment_status === 'paid' 
                            ? 'bg-green-100 text-green-800' 
                            : 'bg-yellow-100 text-yellow-800'
                        }`}>
                          {transaction.payment_status}
                        </span>
                      </div>
                    </div>
                  ))}
                </div>
              ) : (
                <p className="text-gray-500 text-center py-8">No transactions found.</p>
              )}
            </div>
          </div>
        </div>
      </main>

      {/* Browse Plans Modal */}
      {showPlansModal && (
        <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50">
          <div className="bg-white rounded-lg p-6 max-w-4xl w-full mx-4 max-h-96 overflow-y-auto">
            <div className="flex justify-between items-center mb-6">
              <h3 className="text-xl font-medium text-gray-900">Available Subscription Plans</h3>
              <button
                onClick={() => setShowPlansModal(false)}
                className="text-gray-400 hover:text-gray-600 text-2xl"
              >
                Ã—
              </button>
            </div>

            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
              {availablePlans.map((plan) => (
                <div key={plan.product_id} className="border border-gray-200 rounded-lg p-6 hover:shadow-lg transition">
                  <div className="text-center">
                    <h4 className="text-lg font-semibold text-gray-900 mb-2">{plan.name}</h4>
                    <div className="text-3xl font-bold text-blue-600 mb-4">
                      ${plan.price}
                      <span className="text-sm text-gray-500 font-normal">/month</span>
                    </div>

                    <div className="space-y-3 mb-6">
                      <div className="flex items-center justify-center">
                        <span className={`inline-flex px-2 py-1 text-xs font-semibold rounded-full ${
                          plan.auto_renewal_allowed 
                            ? 'bg-green-100 text-green-800' 
                            : 'bg-gray-100 text-gray-800'
                        }`}>
                          {plan.auto_renewal_allowed ? 'Auto-Renewal' : 'Manual Renewal'}
                        </span>
                      </div>

                      <div className="text-sm text-gray-600">
                        <p>âœ“ Full access to features</p>
                        <p>âœ“ 24/7 customer support</p>
                        <p>âœ“ Regular updates</p>
                      </div>
                    </div>

                    <button className="w-full bg-blue-600 text-white py-2 px-4 rounded-lg hover:bg-blue-700 transition font-medium">
                      Subscribe Now
                    </button>
                  </div>
                </div>
              ))}
            </div>

            {availablePlans.length === 0 && (
              <div className="text-center py-8">
                <p className="text-gray-500">No subscription plans available at the moment.</p>
              </div>
            )}

            <div className="mt-6 flex justify-end">
              <button
                onClick={() => setShowPlansModal(false)}
                className="px-4 py-2 border border-gray-300 rounded-lg text-gray-700 hover:bg-gray-50 transition"
              >
                Close
              </button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default UserDashboard;
